(503, 1, '2013-08-11 18:05:48', '2013-08-11 18:05:48', '[row]\n[col span=\"4\"]\n[featured_box title=\"Free Shipping on all ordres\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"left\"]Get Free Shipping on all orders over $75 and free returns to our UK returns centre! Items are dispatched from the US and will arrive in 5-8 days.\n[/featured_box]\n[/col]\n\n[col span=\"4\"]\n[featured_box title=\"Amazing customer service\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"left\"]Get Free Shipping on all orders over $75 and free returns to our UK returns centre! Items are dispatched from the US and will arrive in 5-8 days.\n[/featured_box]\n[/col]\n\n[col span=\"4\"]\n[featured_box title=\"No Customs or Duty Fees!\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"left\"]We pay these fees so you don’t have to! The total billed at checkout is the final amount you pay, inclusive of VAT, with no additional charges at the time of delivery!\n[/featured_box]\n[/col]\n\n[/row]', 'Shop features - icon left', '', 'publish', 'closed', 'closed', '', 'shop-features-icon-left', '', '', '2013-08-11 18:05:48', '2013-08-11 18:05:48', '', 0, 'http://localhost:8888/test/?post_type=blocks&amp;p=503', 0, 'blocks', '', 0),
