(464, 1, '2013-08-11 15:41:20', '2013-08-11 15:41:20', '<p class=\"lead text-center\">\nUX Sliders are inserted with a Shortcode Generator. Its possible to slide almost\nanything by wrapping<strong> &#91;ux_slider]   &#91;/ux_slider] </strong>around the content.\n\n<hr />\n\n<strong>Available parameters:</strong>\n<pre>&#91;ux_slider timer=\"4500\" arrows=\"false/true\" bullets=\"false/true\" auto_slide=\"false/true\" hide_nav=\"false/true\" nav_color=\"dark/light\"]\n\n   &#91;ux_banner] &#91;/ux_banner]\n   &#91;ux_banner] &#91;/ux_banner]\n   &#91;ux_banner] &#91;/ux_banner]\n\n&#91;/ux_slider]</pre>\n[title text=\"Simple slider with banners\"]\n\n[ux_slider]\n[ux_banner bg=\"#333\" height=\"400px\" link=\"\" animation=\"fadeInLeft\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 1</h1>\n[/ux_banner]\n[ux_banner bg=\"#666\" height=\"400px\" link=\"\" animation=\"flipInX\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 2</h1>\n[/ux_banner]\n[/ux_slider]\n<pre><b>&#91;ux_slider]</b>\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n<b>&#91;/ux_slider]</b></pre>\n[title text=\"Slider with no directional navigaition\"]\n\n[ux_slider arrows=\"false\"]\n[ux_banner bg=\"#333\" height=\"400px\" link=\"\" animation=\"fadeInLeft\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 1</h1>\n[/ux_banner]\n[ux_banner bg=\"#666\" height=\"400px\" link=\"\" animation=\"flipInX\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 2</h1>\n[/ux_banner]\n[/ux_slider]\n<pre><b>&#91;ux_slider <b>arrows=\"false\"</b>]</b>\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n<b>&#91;/ux_slider]</b></pre>\n[title text=\"Slider with dark navigation items\"]\n\n[ux_slider nav_color=\"dark\"]\n[ux_banner bg=\"#ccc\" height=\"400px\" link=\"\" animation=\"fadeInLeft\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 1</h1>\n[/ux_banner]\n[ux_banner bg=\"#eee\" height=\"400px\" link=\"\" animation=\"flipInX\" text_pos=\"center\" text_color=\"light\" text_width=\"80%\" ]\n<h1>Banner 2</h1>\n[/ux_banner][/ux_slider]\n<pre><b>&#91;ux_slider <b>nav_color=\"dark\"</b>]</b>\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n   &#91;ux_banner] Banner content &#91;/ux_banner]\n<b>&#91;/ux_slider]</b></pre>', 'Shortcode - UX Sliders', '', 'publish', 'closed', 'closed', '', 'shortcode-ux-sliders', '', '', '2013-08-11 15:41:20', '2013-08-11 15:41:20', '', 288, 'http://localhost:8888/test/?page_id=464', 0, 'page', '', 0),
