(577, 1, '2013-08-14 19:02:03', '2013-08-14 19:02:03', '<p class=\"lead text-center\">A Beautiful WooCommerce theme with amazing User Experience</p>\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"left center\" text_width=\"30%\" text_align=\"left\"]\n<h2 class=\"uppercase\">Beautiful responsive design</h2>\n___\n<p class=\"lead\">Flatsome looks beautiful on mobile phones and tablets.</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInRight\" text_pos=\"right center\" text_width=\"25%\" ]\n<h2 class=\"uppercase\">Touch optimized</h2>\n___\n<p class=\"lead\">Sliders and product carousells can be rotated using touch on mobile and tablets.</p>\n[/ux_banner]\n\n<hr />\n\n[ux_slider]\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"flipInX\" text_pos=\"center\" text_width=\"70%\" ]\n<h3 class=\"uppercase\">Smart responsive banner and slider system with animations</h3>\n___\n\n[/ux_banner]\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"center\" text_width=\"70%\" ]\n<h3 class=\"uppercase\">Slide anything using Shortcodes!</h3>\n___\n\n[/ux_banner]\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"center\" text_width=\"70%\" ]\n<h3 class=\"uppercase\">Tons of pre-defined banners included!</h3>\n___\n\n[/ux_banner]\n\n[/ux_slider]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"right center\" text_width=\"30%\" text_align=\"center\"]\n<h2 class=\"uppercase\">Sharp retina ready graphics</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"left top\" text_width=\"30%\" text_align=\"left\"]\n<h2 class=\"uppercase\">Unlimited Color Options</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"right center\" text_width=\"30%\" text_align=\"center\"]\n<h2 class=\"uppercase\">Quick and Easy Mobile navigation</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"left center\" text_width=\"20%\" text_align=\"left\"]\n<h2 class=\"uppercase\">Smart header</h2>\n___\n<p class=\"lead\">Choose between light or dark version, change background, and select left or centered logo</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"left center\" text_width=\"30%\" text_align=\"left\"]\n<h2 class=\"uppercase\">500+ Built-in Google fonts</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"top center\" text_width=\"80%\" ]\n<h3 class=\"uppercase\">Beautiful cart and checkout design</h3>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"center right\" text_width=\"25%\" ]\n<h2 class=\"uppercase\">Catalog Mode</h2>\n___\n<p class=\"lead\">Disable shopping functionality to showcase product catalogs. Choose between showing or hiding prices.\n[/ux_banner]</p>\n\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"flipInY\" text_pos=\"left center\" text_width=\"20%\" text_align=\"left\"]\n<h2 class=\"uppercase\">Built-in Quick View</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInRight\" text_pos=\"left center\" text_width=\"30%\" text_align=\"left\" ]\n<h2 class=\"uppercase\">Blocks Custom Post-type</h2>\n___\n<p class=\"lead\">Blocks Custom Post type lets you create \"Content Blocks\" ready to be inserted anywhere with a shortcode! This makes it easy to maintain hompages etc.</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"flipInY\" text_pos=\"right center\" text_width=\"30%\"]\n<h2 class=\"uppercase\">Beautiful Account Pages</h2>\n___\n\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInDown\" text_pos=\"top center\" text_width=\"80%\"]\n<h2 class=\"uppercase\">CUSTOM CART ICONS</h2>\n___\n<p class=\"lead\">Upload any custom cart icon image</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"left center\" text_width=\"30%\" text_align=\"left\" ]\n<h2 class=\"uppercase\">Pinterest style</h2>\n___\n<p class=\"lead\">Crate a cool landingpage with products using Pinterest-style shortcode.</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"left center\" text_width=\"30%\" text_align=\"left\" ]\n<h2 class=\"uppercase\">Built-in Mega Menu</h2>\n___\n<p class=\"lead\">Create multi-column dropdowns using the default Wordpress Menu manager.</p>\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInLeft\" text_pos=\"left center\" text_width=\"30%\" ]\n<h2 class=\"uppercase\">Optional Wishlist Plugin</h2>\n___\n[/ux_banner]\n\n<hr />\n\n[ux_banner bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" height=\"550px\" animation=\"fadeInRight\" text_pos=\"right center\" text_width=\"30%\" ]\n<h2 class=\"uppercase\">Optional Live Search Plugin</h2>\n___\n[/ux_banner]\n\n<hr />', 'Flatsome Theme Features', '', 'publish', 'closed', 'closed', '', 'features', '', '', '2013-08-14 19:02:03', '2013-08-14 19:02:03', '', 0, 'http://localhost:8888/test/?page_id=577', 0, 'page', '', 0),
(624, 1, '2013-08-18 12:30:42', '2013-08-18 12:30:42', '[background bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" padding=\"30px\" parallax=\"2\" dark=\"false\"]\n\n[block id=\"banner-grid-style\"]\n\n[/background]\n\n<span style=\"line-height: 1.5em;\">[title text=\"weekly featured products\" style=\"center\"]</span>\n\n[ux_featured_products]\n\n[background bg=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" padding=\"30px\"  dark=\"false\"]\n\n[title style=\"center\" text=\"our bestselling products\"]\n\n[ux_bestseller_products products=\"8\"]\n\n[/background]\n<div style=\"height: 30px; display: block;\"></div>\n[row]\n[col span=\"4\"]\n[featured_box title=\"Free Shipping on all ordres\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"center\"]\nGet Free Shipping on all orders over $75 and free returns to our UK returns centre! Items are dispatched from the US and will arrive in 5-8 days.\n[/featured_box]\n[/col]\n\n[col span=\"4\"]\n[featured_box title=\"Amazing customer service\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"center\"]\nGet Free Shipping on all orders over $75 and free returns to our UK returns centre! Items are dispatched from the US and will arrive in 5-8 days.\n[/featured_box]\n[/col]\n\n[col span=\"4\"]\n[featured_box title=\"No Customs or Duty Fees!\" img=\"http://savemari.com/store/zimglamor/wp-content/uploads/2013/08/dummy.gif\" pos=\"center\"]\nWe pay these fees so you don’t have to! The total billed at checkout is the final amount you pay, inclusive of VAT, with no additional charges at the time of delivery!\n[/featured_box]\n[/col]\n\n[/row]\n\n[ux_product_categories number=\"10\" parent=\"\" columns=\"4\" title=\"Our categories\" ]', 'Grid style 3', '', 'publish', 'open', 'closed', '', 'homepage-3-grid-style', '', '', '2013-08-18 12:30:42', '2013-08-18 12:30:42', '', 46, 'http://localhost:8888/t